import css from './Button.module.css'

function Button({ handleMoreBtnClick }) {
  return (
    <div>
      <button
        type="submit"
        name="more"
        className={css.Button}
        onClick={handleMoreBtnClick}
      >
        Load more
      </button>
    </div>
  )
}

export default Button
